CREATE TABLE product(
   id                            BIGINT  NOT NULL PRIMARY KEY 
  ,groupe_aliment                VARCHAR(250) NOT NULL
  ,sousgroupe_aliment            VARCHAR(250) NOT NULL
  ,nom                           VARCHAR(250) NOT NULL
  ,livraison                     VARCHAR(250) NOT NULL
  ,materiau_emballage            VARCHAR(250) NOT NULL
  ,score_unique_ef               NUMERIC(11,9) NOT NULL
  ,changement_climatique         NUMERIC(11,9) NOT NULL
  ,Appauvrissemente_couche_ozone NUMERIC(13,10) NOT NULL
  ,particules                    NUMERIC(11,10) NOT NULL
);
